#include <iostream>
#include <vector>
#include <set>

using namespace std;

class Solution
{
public:
    Solution() // ЧИТ ДЛЯ СКОРОСТИ!!!!!!!!
    {
        ios_base::sync_with_stdio(false);
        cin.tie(NULL);
        cout.tie(NULL);
    }
    int nearestExit(vector<vector<char>> &maze, vector<int> &entrance)
    {
        int res = 0;
        set<vector<int>> front;
        front.insert(entrance);
        while (!front.empty())
        {
            std::cout << "Front size: " << front.size() << std::endl;
            set<vector<int>> next_front;
            for (auto &elem : front)
            {
                if (elem != entrance &&
                    ((elem[0] == 0 || elem[0] == maze.size() - 1) ||
                     (elem[1] == 0 || elem[1] == maze[0].size() - 1)))
                    return res;

                maze[elem[0]][elem[1]] = '+'; // закрфываем то где мы уже были

                // проверка пути сверху
                if (elem[0] != 0 && maze[elem[0] - 1][elem[1]] == '.')
                    next_front.insert({elem[0] - 1, elem[1]});

                // проверка пути snizu
                if (elem[0] != maze.size() - 1 &&
                    maze[elem[0] + 1][elem[1]] == '.')
                    next_front.insert({elem[0] + 1, elem[1]});

                // проверка пути sleva
                if (elem[1] != 0 && maze[elem[0]][elem[1] - 1] == '.')
                    next_front.insert({elem[0], elem[1] - 1});

                // проверка пути sprava
                if (elem[1] != maze[0].size() - 1 &&
                    maze[elem[0]][elem[1] + 1] == '.')
                    next_front.insert({elem[0], elem[1] + 1});
            }
            front = next_front;
            res++;
        }
        return -1;
    }
};

